import React, {useState, useRef, useEffect} from "react";

import '../../../styles/main/coder/reviews/reviewListItem.css';

const ReviewListItem = ({data, index, extView}) => {



    return (
        <div className="review_list_item" onClick={() => extView(data)}>
            <div className="large_list_field">{data.title}</div>
            <div className="small_list_field">{data.reviewCounter}</div>
            <div className="small_list_field">{data.proposalCounter}</div>
            <div className="small_list_field">{new Date(data.timestamp).toLocaleDateString("de-DE")}</div>
        </div>
    );
};

export default ReviewListItem;
